// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
import "@openzeppelin/contracts/access/AccessControl.sol";

// NodeTypes library remains unchanged
library NodeTypes {
    enum NodeRole {
        DESIGNATOR,
        VALIDATOR,
        EXECUTOR
    }

    struct Node {
        address nodeAddress;
        NodeRole role;
        uint256 capacity;
        uint256 performance;
        bool isActive;
        bytes32 clusterId;
    }

    struct Cluster {
